Childcare lets parents work and grow our economy while their kids are safe and cared for. 

But federal resources are about to expire, jeopardizing childcare for 3 million kids.

@SenWarren and I aren’t giving up. Congress must pass emergency childcare funding this fall.

Good wages, real benefits and safe working conditions — for all workers — aren’t too much to ask for.

@Teamsters at UPS keep this economy moving and UPS should bargain in good faith.

Solidarity ✊

Without a safe, affordable place to live nothing else in your life works — not your job, your education, or your health.

@SenatorRounds and I partnered on this bill to reform the USDA’s rural housing programs to meet the challenges rural America faces today.

Let’s get it done!
